import React from 'react';
import './Footer.css';


function Footer() {
    return (
      <div className="Footer">
        <div className="links">
          <p>Sam's Links</p>
          <a href="#" class="fa fa-instagram"></a><span>Instagram</span>
            <a href="#" class="fa fa-twitter"></a><span>Twitter</span>
            <a href="https://www.facebook.com/" class="fa fa-facebook"></a><span>Facebook</span>
            <a href="https://www.facebook.com/" class="fa fa-github"></a><span>GitHub</span>
            <a href="#" class="fa fa-linkedin"></a><span>LinkedIn</span>
          <p>Nicoles's Links</p>
          <a href="#" class="fa fa-instagram"></a><span>Instagram</span>
            <a href="#" class="fa fa-twitter"></a><span>Twitter</span>
            <a href="https://www.facebook.com/" class="fa fa-facebook"></a><span>Facebook</span>
            <span>GitHub</span>
            <a href="#" class="fa fa-linkedin"></a> <span>LinkedIn</span>
        </div>
      </div>
    );
}

export default Footer;
